import React, {Component} from 'react'
import { Button, Form, Message, Select} from 'semantic-ui-react'
import PropTypes from 'prop-types';
import './../css/Login.css';


class SignupForm extends React.Component {
  state = {
    username: '',
    password: '',
    is_staff: false,
  };

  handle_change = e => {
    const name = e.target.name;
    const value = e.target.value;
    this.setState(prevstate => {
      const newState = { ...prevstate };
      newState[name] = value;
      return newState;
    });
  };
  toggle_change = e => {
    this.setState({
      is_staff: !this.state.is_staff,
    });
  }

  render() {
    return (
      <form onSubmit={e => this.props.handle_signup(e, this.state)}>
        <h4>Sign Up</h4>
        <div className="Login">
        <input
        placeholder="UserName"
        className="input"
          type="text"
          name="username"
          value={this.state.username}
          onChange={this.handle_change}
        />
        <label htmlFor="is_staff">R U ADMIN ? </label>
        <input          
        className="input"
          type="checkbox"
          name="is_staff"
          value={this.state.is_staff}
          onChange={this.toggle_change}
        />
        <input
        className="input"
        placeholder="Password"
          type="password"
          name="password"
          value={this.state.password}
          onChange={this.handle_change}
        />
        <Button color="teal" type="submit">SUBMIT </Button>
        </div>
        <h3> OR </h3>
        <br />
         <GoogleLogin
        clientId='915718732611-k5t8orhtst2sjojldkmfkbi8khtptsob.apps.googleusercontent.com'
        buttonText="SIGN IN  WITH GOOGLE"
        onSuccess={responseGoogle}
        onFailure={responseGoogle}
        />
      </form>
    );
  }
}

export default SignupForm;

SignupForm.propTypes = {
  handle_signup: PropTypes.func.isRequired
};
